import styled from "styled-components"

export const Calendario = styled.div`
    width:350px;
    height:350px;
    background:white;
    display: flex ;
    justify-content: space-around ;

    ul{
        border: solid ;

        display: flex ;
        flex-direction: column ;
        justify-content: space-around ;
        align-items: center ;

        li{
            align-items: center ;
            text-align: center ;
            width: 30px;
            list-style-type: none;
        }
    }
    `;
